import {
  DetailsCardDescr,
  DetailsCardSubTitle,
  DetailsCardTitle,
  DetailsCardWrapper,
} from "./DetailsCard.styled";
import { DetailsCardImage } from "./DetailsCardImage/DetailsCardImage";

export const DetailsCard = ({ data, children }) => {
  return (
    <DetailsCardWrapper>
      <DetailsCardImage image={data.profile_path} />

      <div>
        <DetailsCardTitle></DetailsCardTitle>
        <DetailsCardSubTitle></DetailsCardSubTitle>
        <DetailsCardSubTitle></DetailsCardSubTitle>
        <DetailsCardDescr></DetailsCardDescr>
        <DetailsCardSubTitle></DetailsCardSubTitle>
        {children}
      </div>
    </DetailsCardWrapper>
  );
};

